import { Avatar, Button, Menu } from "antd";
import React from "react";
import "./Header.css";
import { UserOutlined } from "@ant-design/icons";

const Header = () => {
  return (
    <header
      style={{
        height: "40px",
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
      }}
    >
      <Menu
        mode="horizontal"
        className="header-menu"
        style={{
          display: "flex",
          justifyContent: "space-between",
          fontSize: "14px",
          fontWeight: "inherit",
        }}
      >
        <div style={{ width: "100%", }}>
          <Menu.Item className="item" key="home">
            <a className="nav-item" href="#home">
              Home
            </a>
          </Menu.Item>
          <Menu.Item className="item" key="courses">
            <a className="nav-item" href="#courses">
              Courses
            </a>
          </Menu.Item>
          <Menu.Item className="item" key="testimonials">
            <a className="nav-item" href="#testimonials">
              Testimonials
            </a>
          </Menu.Item>
          <Menu.Item className="item" key="about">
            <a className="nav-item" href="#about">
              About
            </a>
          </Menu.Item>
        </div>
      </Menu>
      <div class="profile-card">
        <p class="username">John Doe</p>
        <Avatar icon={<UserOutlined />} />
      </div>
    </header>
  );
};

export default Header;
